import React from 'react'
import PropTypes from "prop-types";
import 'bootstrap/dist/css/bootstrap.min.css';
import Alert from 'react-bootstrap/Alert';
import Idx from 'react-bootstrap/idx';
import Variant from 'react-bootstrap/Variant';


export default function Profile(props) {
return (
<div className="Pro">

        {props.children }
        <div>

        <h1>{props.fullName}</h1>
        <ul>
        <li><p>{props.bio}</p></li>
        <li><p>{props.profession}</p></li>
        </ul>
        </div>


        <button onClick={props.handleName}>
          Click
        </button>

        [
          'primary',
          'secondary',
          'success',
          'danger',
          'warning',
          'info',
          'light',
          'dark',
        ].map((variant, idx) => (
          <Alert key={idx} variant={variant}>
            This is a {variant} alert with{' '}
            <Alert.Link href="#">an example link</Alert.Link>. Give it a click if you
            like.
          </Alert>
        ));




</div>
  )
}
Profile.defaultProps={fullName:"No Name !",bio:"No Bio !",profession:"No Profession !"}
Profile.propTypes={fullName:PropTypes.string, bio:PropTypes.string, profession:PropTypes.string}
